import { GET_STUDENTS } from "../actions/action-types";

const initialState = {
  students: [],
  student: {},
};

export default function (state = initialState, action) {
  switch (action.type) {
    case GET_STUDENTS:
      console.log("hello");
      console.log(action.payload);
      return {
        ...state,
        students: action.payload,
        student: action.payload,
      };
    default:
      console.log("hi");
      return state;
  }
}
